import React, { Component } from "react";
import { Navbar, Brand, Container, Nav, Dropdown, Button } from "react-bootstrap";
import { useLocation } from "react-router-dom";
import logo_hyundai from '../img/MOBIS_LOGO.png'


function Header() {
   
  return (

    <Navbar bg="light">
    <Navbar.Brand href="#home"><img src={images['doggy.png']} />
    </Navbar.Brand>
  </Navbar>
 
  
  );
}

export default Header;
